import styles from './App.module.css';
import { useState } from "react";
//app is known as component
function App() {
  const [age, setAge] = useState(0);
  const increaseAge= () => {
    setAge(age+ 1)
  }
  return (
    <div className={styles.App}>
      {age}
      <button onClick={increaseAge}> Increase Age </button>
    </div>
  )
};




export default App;
